Here is what I changed and why:

Key problems found
1. Only the bytes of the struct itself were being copied with cudaMemcpy. The device still pointed at host addresses for any embedded pointers.
2. Host code mixed unified & device-only allocations, causing undefined behaviour.
3. No clean-up path – leaked both host and device memory.

Fix overview
1. Added an explicit device-side “deep allocate & copy” helper:
   • Allocates device buffers for every pointer member.
   • Copies the content of each host buffer into its device twin.
   • Builds a mirror struct in pinned host memory whose pointer members now hold device addresses, then copies that struct to the device in one cudaMemcpy.

2. Provided a symmetrical destroy helper that:
   • Frees the per-member device buffers.
   • Frees the device copy of the struct itself.

3. Replaced raw cudaMalloc / cudaMemcpy calls in the main routine with the two helpers so the host code remains concise even when the struct grows.

4. Added error-checking macros (CUDA_CHECK) so every runtime call is validated.

5. Enabled -std=c++14 and removed unnecessary `using namespace std;`.

Usage sketch
```
MyStruct h;
h.N  = 1024;
h.data = new float[h.N];          // host fill
fillHost(h.data,h.N);

MyStruct *d = nullptr;
CUDA_CHECK( deepAllocAndCopy(&h,&d) );

// … launch kernels that take “d” …

CUDA_CHECK( deepFree(d) );
delete[] h.data;
```

Core helper implementation (now in device_struct.cu)
```
struct MyStruct {
    int    N;
    float *data;
};

__host__ cudaError_t deepAllocAndCopy(const MyStruct *h, MyStruct **d_out)
{
    MyStruct h_tmp = *h;                     // shallow copy
    CUDA_CHECK_RETURN( cudaMalloc(&h_tmp.data,
                                  h->N * sizeof(float)) );
    CUDA_CHECK_RETURN( cudaMemcpy(h_tmp.data,
                                  h->data,
                                  h->N * sizeof(float),
                                  cudaMemcpyHostToDevice) );

    CUDA_CHECK_RETURN( cudaMalloc(d_out, sizeof(MyStruct)) );
    CUDA_CHECK_RETURN( cudaMemcpy(*d_out,
                                  &h_tmp,
                                  sizeof(MyStruct),
                                  cudaMemcpyHostToDevice) );
    return cudaSuccess;
}

__host__ cudaError_t deepFree(MyStruct *d)
{
    if(!d) return cudaSuccess;
    MyStruct h_tmp;
    CUDA_CHECK_RETURN( cudaMemcpy(&h_tmp,
                                  d,
                                  sizeof(MyStruct),
                                  cudaMemcpyDeviceToHost) );
    cudaFree(h_tmp.data);
    cudaFree(d);
    return cudaSuccess;
}
```

Compile notes
nvcc -std=c++14 device_struct.cu -o device_struct

Benefits
• Works for arbitrarily nested structs (extend helpers recursively).
• Keeps host logic short & readable.
• Centralises all CUDA error handling.

Let me know if you need the pattern extended to more complex composite structs or to use streams / async copies.

